import React, { useState } from 'react';

// Mock data for feed items
const mockFeedItems = [
  {
    id: 1,
    type: 'signal',
    token: 'PEPE',
    strategy: 'Meme Momentum',
    timestamp: '2m ago',
    details: {
      price: '$0.00000123',
      volume: '+250%',
      holders: '12,345',
      marketCap: '$1.2M'
    },
    status: 'active'
  },
  {
    id: 2,
    type: 'match',
    token: 'DOGE',
    strategy: 'Elon Tweet Alert',
    timestamp: '5m ago',
    details: {
      tweet: 'Elon Musk tweeted about Dogecoin',
      sentiment: 'positive',
      engagement: 'high'
    },
    status: 'active'
  },
  {
    id: 3,
    type: 'signal',
    token: 'SHIB',
    strategy: 'Whale Movement',
    timestamp: '10m ago',
    details: {
      whaleAddress: '0x123...456',
      amount: '1,000,000,000 SHIB',
      value: '$12,000'
    },
    status: 'expired'
  }
];

const FeedItem = ({ item }) => {
  return (
    <div className={`p-4 rounded-lg border ${item.status === 'active' ? 'border-purple-500/30 bg-purple-500/10' : 'border-zinc-800 bg-zinc-900/50'} mb-4`}>
      <div className="flex items-start justify-between">
        <div className="flex items-center space-x-3">
          <div className={`w-2 h-2 rounded-full ${item.status === 'active' ? 'bg-green-500' : 'bg-zinc-600'}`} />
          <div>
            <h3 className="font-bold text-lg">{item.token}</h3>
            <p className="text-sm text-zinc-400">{item.strategy}</p>
          </div>
        </div>
        <span className="text-sm text-zinc-500">{item.timestamp}</span>
      </div>
      
      <div className="mt-3">
        {Object.entries(item.details).map(([key, value]) => (
          <div key={key} className="flex justify-between text-sm py-1">
            <span className="text-zinc-400">{key}:</span>
            <span className="text-white">{value}</span>
          </div>
        ))}
      </div>

      <div className="mt-3 flex justify-end space-x-2">
        <button className="px-3 py-1 text-sm rounded bg-purple-500/20 text-purple-400 hover:bg-purple-500/30">
          View Strategy
        </button>
        <button className="px-3 py-1 text-sm rounded bg-zinc-800 text-white hover:bg-zinc-700">
          Trade
        </button>
      </div>
    </div>
  );
};

const FeedPage = () => {
  const [filter, setFilter] = useState('all');

  return (
    <div className="min-h-screen bg-[#0f0f0f] px-6 py-10 text-white">
      <div className="max-w-4xl mx-auto">
        <div className="flex items-center justify-between mb-8">
          <h1 className="text-3xl font-bold">📡 Signal Feed</h1>
          <div className="flex space-x-2">
            <button 
              className={`px-4 py-2 rounded-full ${filter === 'all' ? 'bg-purple-500 text-white' : 'bg-zinc-800 text-zinc-400'}`}
              onClick={() => setFilter('all')}
            >
              All
            </button>
            <button 
              className={`px-4 py-2 rounded-full ${filter === 'active' ? 'bg-purple-500 text-white' : 'bg-zinc-800 text-zinc-400'}`}
              onClick={() => setFilter('active')}
            >
              Active
            </button>
            <button 
              className={`px-4 py-2 rounded-full ${filter === 'expired' ? 'bg-purple-500 text-white' : 'bg-zinc-800 text-zinc-400'}`}
              onClick={() => setFilter('expired')}
            >
              Expired
            </button>
          </div>
        </div>

        <div className="space-y-4">
          {mockFeedItems
            .filter(item => filter === 'all' || item.status === filter)
            .map(item => (
              <FeedItem key={item.id} item={item} />
            ))
          }
        </div>
      </div>
    </div>
  );
};

export default FeedPage;
